  constructor(props) {
    super(props);
  }

  state = {
    currentPage: null,
    word: "Test"
  }

  changeWord = (newWord) => {
    console.log("changeWord called")
    this.setState({
      word: "Success!"
    })

  }


  render() {
    return (
      <div>
        <h1>ryan slevin</h1>
        <NavBar onClick={this.changeWord}/>
        <p>{this.state.word}</p>
      </div>
    );

  }

}

export default App;
